import React from 'react';
import {
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  DialogTitle,
  Input,
  TextField
} from '@material-ui/core';
import { gql, useMutation } from '@apollo/client';

export default function FormDialog(props){
  const handleClose = () => {
    props.toggleFormDialog();
  };

  const ADD_FAMILY_MEMBER = gql`
    mutation AddFamilyMember($first_name: String!, $last_name: String!){
      addFamilyMember(first_name: $first_name, last_name: $last_name){
        id
        first_name
        last_name
      }
    }
  `;

  const submitForm = (event) => {
    event.preventDefault();
    console.log('event', event);
  };

  return(
    <Dialog open={props.formDialogState} onClose={handleClose}>
    <form onSubmit={submitForm}>
      <DialogTitle>Add Family Member</DialogTitle>
      <DialogContent>
        <DialogContentText>Please provide the following information about the family member that you'd like to add to the Benefits Dashboard</DialogContentText>
          <TextField
            id=""
            fullWidth
            label="First Name"
          />
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose} color="secondary">
          Cancel
        </Button>
        <Button type="submit" color="primary">
          Add
        </Button>
      </DialogActions>
      </form>
    </Dialog>
  );
}
